def solution(stdin: str) -> str:
    n = int(stdin.split()[0])
    a = list(map(int, stdin.split()[1].split()))
    max_len = 0
    ans = 'R'

    def dp(n, a, res, ans):
        if n == 0:
            nonlocal max_len, ans
            if len(res) > max_len:
                max_len = len(res)
                ans = res
            return
        if a[0] > res[-1]:
            res.append('R')
            dp(n - 1, a, res, ans)
            res.pop()
        else:
            res.append('L')
            dp(n - 1, a, res, ans)
            res.pop()

    dp(n, a, [], ans)
    return ''.join(ans)


