    def swap(a, b):
        tmp = a
        a = b
        b = tmp
        return a, b

    def find_swap(s, t):
        swaps = []
        moves = []
        if len(s)!= len(t):
            return -1
        if len(s) == 1:
            return 0

        if s == t:
            return 0

        if s == t[::-1]:
            return len(s)

        for i in range(len(s)):
            # swap
            if s[i]!= t[i]:
                a, b = swap(s[i], t[i])
                moves.append(a)
                moves.append(b)
                swaps.append(i)

        if not swaps:
            return -1

        if len(swaps) == len(s) - 1:
            return moves

        return -1

    def step(poss, s, t, moves, swaps):
        if len(swaps) == len(s) - 1:
            if swap(s[swaps[0]], s[swaps[1]]) == (t[moves[0]], t[moves[1]]):
                return moves

        if len(poss) == 0:
            return -1

        if len(poss) == 1:
            return -1

        for i in range(len(poss)):
            if poss[i] == len(s):
                return -1
            s_copy = list(s)
            t_copy = list(t)

            # move
            moves = moves + poss[i]
            if swap(s_copy[poss[i]], s_copy[poss[i] + 1]) == (t_copy[moves[0]], t_copy[moves[1]]):
                moves = moves + 1
                moves = moves + poss[i] + 1

            # swap
            if swap(s_copy[poss[i]], s_copy[poss[i] + 1]) == (t_copy[moves[0]], t_copy[moves[1]]):
                moves = moves + 1
                moves = moves + poss[i] + 1

            if swap(s_copy[poss[i]], s_copy[poss[i] + 1]) == (t_copy[moves[0]], t_copy[moves[1]]):
                return -1

        if not (poss[0] == 0 or poss[-1] == len(s) - 1):
            # swap
            moves = moves + poss[0] + 1
            moves = moves + poss[-1] + 1

        moves = moves + len(poss) + 1
        moves = moves + len(poss) + 1

        return step(poss, s, t, moves, swaps)

    # no need to swap again
    poss = find_swap(s, t)

    if poss == -1:
        return -1

    return step(poss, s, t, 0, [-1] * len(poss))

