    a = list(map(int, stdin.split()))
    k = a[1]
    n = a[0]
    def getMax(a):
        maxi = -1
        for i in range(n):
            if a[i] > maxi:
                maxi = a[i]
        return maxi

    def getMin(a):
        mini = n
        for i in range(n):
            if a[i] < mini:
                mini = a[i]
        return mini

    def move(a, max, mini):
        for i in range(n):
            if a[i] == max:
                a[i] = a[i] + 1
            elif a[i] == mini:
                a[i] = a[i] - 1

    def moveMin(a, maxi, mini):
        for i in range(n):
            if a[i] == maxi:
                a[i] = a[i] - 1
            elif a[i] == mini:
                a[i] = a[i] + 1

    def dfs(a, k):
        if a == k:
            return 0
        if len(a) == 1:
            return 1
        return min(dfs(a[1:], k) + 1, dfs(a[1:], k) + dfs(a[:len(a)-1], k))

    maxi = getMax(a)
    mini = getMin(a)
    ans = dfs(a, k)
    move(a, maxi, mini)
    if ans == 0:
        return ans
    moveMin(a, maxi, mini)
    return ans

